var cakeboxChart=new function(){this.getChartObject=function(t){switch(t){case"bar":return cakeboxChartBar;case"line":return cakeboxChartLine;case"line_area":return cakeboxChartLineArea;case"pie":return cakeboxChartPie;default:return cakeboxChartBar}},this.getChartOptions=function(t,e,r,i){return this.getChartObject(t).getChartOptions(e,r,i)},this.getSerieFormat=function(t,e,r){return this.getChartObject(t).getSerieFormat(e,r)},this.getXAxis=function(t,e){return this.getChartObject(t).getXAxis(e)},this.getYAxis=function(t,e,r){return this.getChartObject(t).getYAxis(e,r)},this.getDemoOption=function(t){return this.getChartObject(t).getDemoOption()},this.getDemoSerie=function(t){return this.getChartObject(t).getDemoSerie()},this.getDemoXAxis=function(t){return this.getChartObject(t).getDemoXAxis()},this.getDemoYAxis=function(t){return this.getChartObject(t).getDemoYAxis()}};